// src/pages/PaymentPage.jsx
import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { rentBook } from "../services/rentalService";
import "../styles/Payment.css";

const PaymentPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  
  const [loading, setLoading] = useState(false);
  const [success, setSuccess] = useState(false);

  // Debugging: Check if state arrived
  useEffect(() => {
    console.log("Location State:", location.state);
  }, [location]);

  const book = location.state?.book;
  const duration = location.state?.duration;

  if (!book || !duration) {
    return (
      <div className="payment-container">
        <div className="error-card">
          <h2>No payment details found</h2>
          <p>Please select a book from the catalog first.</p>
          <button onClick={() => navigate("/catalog")} className="pay-btn">
            Back to Catalog
          </button>
        </div>
      </div>
    );
  }

  const pricePerDay = book.price_per_day || 0;
  const totalPrice = pricePerDay * duration;

  const confirmPayment = async () => {
    setLoading(true);
    try {
      // Use book.id or book.isbn depending on your backend expectations
      await rentBook(book.id); 
      setSuccess(true);
    } catch (err) {
      alert(err.response?.data?.error || "Rental failed. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="payment-container">
      {!success ? (
        <>
          <h1>ðŸ’³ Payment Confirmation</h1>
          <div className="payment-card">
            <img 
              src={book.image_url || "https://via.placeholder.com/160x240"} 
              alt={book.title} 
              onError={(e) => { e.target.src = "https://via.placeholder.com/160x240" }}
            />
            <div className="payment-info">
              <h2>{book.title}</h2>
              <p><strong>Author:</strong> {book.author}</p>
              <p><strong>Category:</strong> {book.category}</p>
              <hr />
              <p><strong>Price per day:</strong> â‚¹{pricePerDay}</p>
              <p><strong>Duration:</strong> {duration} days</p>
              <p className="total-amount">
                <strong>Total Amount:</strong> â‚¹{totalPrice}
              </p>
            </div>
          </div>

          <button className="pay-btn" disabled={loading} onClick={confirmPayment}>
            {loading ? "Processing..." : `Pay â‚¹${totalPrice}`}
          </button>
        </>
      ) : (
        <div className="success-card">
          <h1>âœ… Rental Successful</h1>
          <p>You have successfully rented <strong>{book.title}</strong>.</p>
          <button className="pay-btn" onClick={() => navigate("/my-rentals")}>
            Go to My Rentals
          </button>
        </div>
      )}
    </div>
  );
};

export default PaymentPage;
